import React, { Component } from 'react'
import {MyContext} from './App';
export default class Guest extends Component {
    render() {
        return (
            <>
                   <MyContext.Consumer>
                                      {
                                       ({data,handleClick})=>(
                                         
                                             <button onClick={handleClick}>change</button>
                                        )}
                          
                   </MyContext.Consumer>
                   <h1>Guest component</h1>
            </>
        )
    }
}
